import { Drawer, IconButton } from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";

interface LeftDrawerProps {
  open: boolean;
}

export default function LeftDrawer({ open }: LeftDrawerProps) {
  return (
    <Drawer
      anchor="left"
      open={open}
      variant="persistent"
      sx={{
        backgroundColor: "black",
      }}
    >
      <IconButton>
        <MenuIcon />
        <h1>Menu</h1>
      </IconButton>
    </Drawer>
  );
}
